-- =============================================
-- Author:		Bryan Panjavan
-- Create date: 2009.03.21
-- Description: UPDATE operation for FileData
-- =============================================
CREATE PROCEDURE [dbo].[sp_FileData_Update]
	-- Add the parameters for the stored procedure here
	(
		@fileId			uniqueidentifier,
		@fileBytes		image,
		@fileName		varchar(100),
		@fileExtension	varchar(25),
		@createdOn		datetime,
		@createdBy		varchar(100),
		@modifiedOn		datetime,
		@modifiedBy		varchar(100)
	)

AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

UPDATE [dbo].[FileData]
   SET [FileBytes] = @fileBytes
      ,[FileName] = @fileName
      ,[FileExtension] = @fileExtension
      ,[CreatedOn] = @createdOn
      ,[CreatedBy] = @createdBy
      ,[ModifiedOn] = @modifiedBy
      ,[ModifiedBy] = @modifiedOn
 WHERE FileId = @fileId

END
' 
END
